import React, {useState} from 'react';
import {View, ActivityIndicator, Alert, Platform} from 'react-native';
import {Button} from 'react-native-paper';
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import Share from 'react-native-share';
import moment from 'moment';
import {StackNavigationProp} from '@react-navigation/stack';
import {RouteProp} from '@react-navigation/native';

type RootStackParamList = {
  Home: undefined;
  Pdf: {alumnos: string[]};
};

type PdfScreenNavigationProp = StackNavigationProp<RootStackParamList, 'Pdf'>;
type PdfScreenRouteProp = RouteProp<RootStackParamList, 'Pdf'>;

type Props = {
  navigation: PdfScreenNavigationProp;
  route: PdfScreenRouteProp;
};

const PdfScreen: React.FC<Props> = ({route}) => {
  const {alumnos} = route.params;
  const [isGenerating, setIsGenerating] = useState(false);

  const generarPDF = async () => {
    setIsGenerating(true);

    // Obtener la temporada actual
    const mesActual = moment().month(); // 0 (Enero) a 11 (Diciembre)
    let añoInicio, añoFin;

    if (mesActual >= 8) {
      // Si es septiembre (8) o después
      añoInicio = moment().year();
      añoFin = añoInicio + 1;
    } else {
      añoFin = moment().year();
      añoInicio = añoFin - 1;
    }

    const temporada = `${añoInicio}-${añoFin}`;

    // Crear la tabla en HTML
    const meses = [
      'Sep',
      'Oct',
      'Nov',
      'Dic',
      'Ene',
      'Feb',
      'Mar',
      'Abr',
      'May',
      'Jun',
      'Jul',
      'Ago',
    ];

    const logoBase64 = '';

    const maxFilasPorHoja = 13;
    const paginas = [];
    for (let i = 0; i < alumnos.length; i += maxFilasPorHoja) {
      const alumnosPagina = alumnos.slice(i, i + maxFilasPorHoja);
      const tablaHTML = `
        <table>
          <tr>
            <th>Alumnos</th>
            ${meses.map(mes => `<th>${mes}</th>`).join('')}
          </tr>
          ${alumnosPagina
            .map(
              alumno => `
              <tr>
                <td>${alumno}</td>
                ${meses.map(() => `<td></td>`).join('')}
              </tr>
            `,
            )
            .join('')}
        </table>
      `;
      paginas.push(tablaHTML);
    }
    const htmlCompleto = `
      <html>
      <head>
        <style>
          body {
            font-family: 'Helvetica Neue', Helvetica, Arial, sans-serif;
            margin: 0;
            padding: 20px;
          }
          .header {
            display: flex;
            align-items: center;
            margin-bottom: 20px;
          }
          .logo {
            width: 100px;
            margin-top: 20px;
          }
          .title {
            flex: 1;
            text-align: center;
            color: #333;
            font-size: 24px;
            font-weight: bold;
            margin-top: 20px;
          }
          table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 20px;
            page-break-after: always;
          }
          th, td {
            border: 1px solid #666;
            padding: 12px;
            text-align: center;
          }
          th {
            background-color: #800080;
            color: white;
          }
          tr:nth-child(even) {
            background-color: #f2f2f2;
          }
          tr:hover {
            background-color: #ddd;
          }
        </style>
      </head>
      <body>
        ${paginas
          .map(
            (pagina, index) => `
            <div class="header">
              <img class="logo" src="data:image/png;base64,${logoBase64}" alt="Logo" />
              <div class="title">Temporada ${temporada} - Página ${
              index + 1
            }</div>
            </div>
            ${pagina}
          `,
          )
          .join('')}
      </body>
      </html>
    `;

    // Generar el PDF
    const options = {
      html: htmlCompleto,
      fileName: `Temporada_${temporada}`,
      directory: 'Documents',
    };

    try {
      const file = await RNHTMLtoPDF.convert(options);

      if (!file.filePath) {
        throw new Error('No se pudo generar el archivo PDF.');
      }

      const filePath = file.filePath;

      let uri = filePath;
      if (Platform.OS === 'android') {
        uri = `file://${filePath}`;
      }

      await Share.open({
        url: uri,
        type: 'application/pdf',
        title: 'Compartir PDF',
      });

      setIsGenerating(false);
    } catch (error) {
      setIsGenerating(false);
      console.error(error);
      Alert.alert('Error', 'Ocurrió un error al generar el PDF.');
    }
  };

  return (
    <View style={{flex: 1, padding: 16, justifyContent: 'center'}}>
      {isGenerating ? (
        <ActivityIndicator size="large" />
      ) : (
        <Button mode="contained" onPress={generarPDF}>
          Generar y Compartir PDF
        </Button>
      )}
    </View>
  );
};

export default PdfScreen;
